import React from 'react'

import { Switch, Route } from 'react-router-dom'

import Home from './pages/Home/Home'


const Routes = () => {
  return (
    <Switch>
        <Route exact path='/' />
        <Route exact path='/Auth'/>
    </Switch>
  )
}

export default Routes
